          "original_name": "The Early Show",
          "overview": "The Early Show is an American morning television show which was broadcast by CBS from New York City from 1999 to 2012. The program aired live from 7 to 9 a.m. Eastern Time Monday through Friday in the Eastern time zone; most affiliates in the Central, Mountain, and Pacific time zones aired the show on tape-delay from 7 to 9 a.m. local time. The Saturday edition aired live from 7 to 9 a.m. Eastern Time as well, but a number of affiliates did not carry it or aired it later on tape-delay. It premiered on November 1, 1999, and was the newest of the major networks' morning shows, although CBS has made several attempts to program in the morning slot since 1954. The show aired as a division of CBS News.\n\nThe Early Show, like many of its predecessors, traditionally ran last in the ratings to its rivals, NBC's Today and ABC's Good Morning America. Much like NBC's The Today Show and The Tonight Show, the title The Early Show was analogous to that of CBS's late-night talk show, The Late Show.",
